DROP DATABASE IF EXISTS `korreyos`;
CREATE DATABASE IF NOT EXISTS `korreyos`;
USE `korreyos`;

DROP TABLE IF EXISTS `estados`;
CREATE TABLE IF NOT EXISTS `estados` (
  `id` int NOT NULL AUTO_INCREMENT,
  `nome` varchar(200) NOT NULL,
  `data_criacao` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nome` (`nome`)
);

DROP TABLE IF EXISTS `cidades`;
CREATE TABLE IF NOT EXISTS `cidades` (
  `id` int NOT NULL AUTO_INCREMENT,
  `id_estado` int NOT NULL,
  `nome` varchar(200) NOT NULL,
  `data_criacao` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nome` (`nome`),
  KEY `id_estado` (`id_estado`),
  CONSTRAINT `cidades_ibfk_1` FOREIGN KEY (`id_estado`) REFERENCES `estados` (`id`)
);

DROP TABLE IF EXISTS `bairros`;
CREATE TABLE IF NOT EXISTS `bairros` (
  `id` int NOT NULL AUTO_INCREMENT,
  `id_cidade` int NOT NULL,
  `nome` varchar(200) NOT NULL,
  `data_criacao` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nome` (`nome`),
  KEY `id_cidade` (`id_cidade`),
  CONSTRAINT `bairros_ibfk_1` FOREIGN KEY (`id_cidade`) REFERENCES `cidades` (`id`)
);

DROP TABLE IF EXISTS `ruas`;
CREATE TABLE IF NOT EXISTS `ruas` (
  `id` int NOT NULL AUTO_INCREMENT,
  `id_bairro` int NOT NULL,
  `cep` char(9) NOT NULL,
  `nome` varchar(200) NOT NULL,
  `data_criacao` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nome` (`nome`),
  UNIQUE KEY `cep` (`cep`),
  UNIQUE KEY `cep_2` (`cep`),
  KEY `id_bairro` (`id_bairro`),
  CONSTRAINT `ruas_ibfk_1` FOREIGN KEY (`id_bairro`) REFERENCES `bairros` (`id`)
);


DROP TABLE IF EXISTS `clientes`;
CREATE TABLE IF NOT EXISTS `clientes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `nome` varchar(250) NOT NULL,
  `genero` enum('M','F','O') DEFAULT NULL,
  `saldo` decimal(10,2) DEFAULT NULL,
  `rua_id` int NOT NULL,
  `numero` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `rua_id` (`rua_id`),
  CONSTRAINT `clientes_ibfk_1` FOREIGN KEY (`rua_id`) REFERENCES `ruas` (`id`)
);



